import styled from 'styled-components';

const StyledCounter = styled.div`
    font-family: 'Share Tech Mono', monospace;
`;

const Counter = ({ value }) => {

    return (
        <StyledCounter>{value}</StyledCounter>
    );
  };

  export default Counter;
